A tree is a directed graph, which means that there is a designated starting node, and for each node in the graph there is exactly one way of moving to the next node.
So, if I have a set of nodes, I can move around in the graph and end up somewhere else. Now, we need to consider the nodes that represent choices that I can make. We want only those choices that represent one way of doing that.
To do that, we need to consider that the graphs are directed. If there happens to be more than one possible way of doing things, that's fine, we represent that in the graph with an edge where there are many possible ways of moving to the next (or first) node in the graph.
